import axios from 'axios'
import React, { Component } from 'react'

export default class Contact extends Component {

  state={
    m:"omar"
  }
  

    componentDidMount(){
      
    //  axios.get("http://127.0.0.1:8000/product");


       axios(
        {
          url:"/product",
          baseURL:"http://127.0.0.1:8000/api",
          method:"get"
        }
       ).then((response)=>{
        this.setState({
          this:response
        })
       })

    }

    
    render() {
    return (

      
      <div>{this.state.m}</div>
    )
  }
}
